import React, { Component, Fragment } from "react";
import { Link } from "react-router-dom";
import "./styles.scss";

class HeaderLeft extends Component {
  onLogOut = () => {
    localStorage.removeItem("username");
    this.props.history.push("/global/login");
  };
  render() {
    var checkUser = localStorage.getItem("username") ? true : false;
    var userValue = JSON.parse(localStorage.getItem("username"));
    return (
      <Fragment>
        <ul className="nav justify-content-end">
          <li className="nav-item">
            <Link to="/" className=" d-none d-xl-inline-block">
              <img
                src="data:image/png;base64,"
                alt=""
              />
            </Link>
          </li>
          <li className="nav-item user">
            <Link to="/global/login" className="login ms-4">
              <i className="fas fa-user"></i>
            </Link>
            {checkUser ? (
              <ul className="nav sub rounded">
                <li className="nav-item">
                  <Link className=" " to="/">
                    {userValue}
                  </Link>
                </li>
                <li className="nav-item">
                  <button
                    className="btn shadow-none"
                    to="/"
                    onClick={this.onLogOut}
                  >
                    LOG OUT
                  </button>
                </li>
              </ul>
            ) : (
              ""
            )}
          </li>
        </ul>
      </Fragment>
    );
  }
}

export default HeaderLeft;
